"5506eb6161a07356d96e91770d25d5a0f22200ef":"Conditions","8b70c504aa09cadfdc4baac6909b492d9d63db71":"Purchased",c3c49d3e838c8fe813d360aea7dc6b792948afde:"Markets","9bec3db35af828e22b2b5e9702a359fa011b03e9":"Trade Type blocks have to be added to submarket blocks",b3214afd299cfa3952efc8d8853c7b5a7f340405:"does not support category:","4166e06fcdc703410a1edb28a7bcea9ed0a4bfdb":"Allowed categories are","11ee9c5d534cc8d22651092222b532917594161a":"Minimum duration is","5283ac04c9a8ba8a937d1edb4ba986aeefce8bf1":"Number of ticks must be between 5 and 10",ace1342bc3720b77ce510b93074041e7386d209e:"Expiry time cannot be equal to start time",fed3e7bd6696fb97a12d720845ab5388456bfc3b:"Prediction must be one digit","762d334c830574af86dd1fc75ce6003b0e57548c":"Submarket blocks can only accept trade type blocks",a8dc1b431f260fc1aed77d54595779c1b49c4f5b:"Submarket blocks have to be added to the trade block","312677f238bced75f4a7998263a4cd831c007be9":"The trade block can only accept submarket blocks","7386b7aecaf7dee307dffabf3024e6fea8b3e964":"The trade block cannot be inside binary blocks","6e3674eaa8061ce7f428a6fa097209b1de96901d":"must be added to the condition block",f561afb9f2cdb16af20dd7553a825e99f761d590:"must be added inside the strategy block","9a13790ed481fe5c946705cb2dc761a5252b1893":"must be added inside the finish block",aac1569ccf6b1a11b0ad0fbefdb9ffc777b4c733:"Click to select","1c89b0a9ffe86e1db3b9f926d215e57f5a7b445d":"Welcome to the introduction to the binary bot, we will go through the basic steps to create a working bot. Skip this tutorial by clicking on the <b>X</b> button. Skip each step by <b>Right Arrow (","401ddc8376746eceaddf4dba5b8c91dc6d5f6fbe":")</b> on the keyboard.",b220ddf901eb3413d07d77926409ca33b10244e8:"This is where you can define your blocks.","535d175b893509fc05cdb56e7e2376d4bb0ae7a5":"You can see the <b>main blocks</b> (Step 1, 2 and 3) already added to the workspace.","3e2769027bf3c973c38103dcce6482586b993374":"You cannot add or delete the main blocks, but you can move them to a desired place in the workspace.",f4bad39e0da47ce1f413083ec703c9bdb4e821bc:"To start pick a <b>symbol</b> block from markets. Some steps like this one don't have the <b>Next step</b> button, therefore you need to follow the instructions to go to the next step, (in this case picking a symbol from left should lead you to the next step.)",befc05c5b14b4c155cea1552fc019fc100adeddb:"Great! Now add it to the <b>Define Trade</b> block.","25d5b0a626412f2ba48c10ec8a56c9efc62b5a49":"Alright! Now pick a <b>trade type</b> block.",a8ce204c869e6df24277611290801e35b787c870:"OK! Now add it to the symbol you added in the previous step.",d518cd463b95acf6b2b42414c41f19408521cd00:"Very good! It's time to add the options needed by the trade type block, pick a number",e20d6b63e449cc63246eb171e6d4368c060a60f5:"from the Math menu","80f10315585e12fc0dd2f7b7faa8a09a8034b79c":"Click on the number block to edit its value",fc8045d8d70d2ae8c31c79b57623fc59609135e7:"change the value to 5 and add it to the <b>ticks</b> field of the trade type block","6e317f95b71981900a70cb465671f1021bbbf5a8":"OK, Now add all remaining options to the trade type block","282ea251bdfda29ddf988b813e77ebb65c7d6c0d":"That's it, now you have a complete trade block with its options. It's time to define a strategy","061c155afc9f43271499f20bcce319696f4aa313":"This is a <b>Strategy</b> block. All the blocks you put in here are run for each and every tick received.",dbf1a7aa30ed10d018559d296772a994b1ad45be:"The received tick value is in the block <b>Tick Value</b> and the tick direction (up or down) is in the block <b>Tick Direction</b>. You can pick them from the <b>Strategy</b> menu",a4fda48ca1d26066926c0c7c007036585e797626:"For this tutorial we are not going to use those blocks, so we create our strategy by adding a <b>purchase</b> block. Please pick a purchase block","40cb4329c38e75111dfcf1c3a7d53f9ec44f63d2":"Now add it to the Strategy block.","4a362e853d0afc9cca5f580cc02999ee0ea12f84":"Nicely Done! The purchase block initiates a purchase defined by its dropdown list, e.g. if your trade type block is of <b>Rise/Fall</b> type you will have <b>Rise</b> and <b>Fall</b> options on the purchase block to select from.","039b5485ec321d83859b48fc91bf895e52429312":"A Strategy block consisting of only a purchase block means to purchase as soon as the first tick was received.","6818232027fc3ec833d6aafc70e8814bde778205":"After a purchase was the bot waits till the purchase is completed, and then gives the control to the <b>On Finish</b> block","2eb458fc248cf538e898779cd4814e28af5db24b":"Same as the Strategy block, the <b>On Finish</b> block can have multiple blocks defining its functionality. The On Finish block defines what to do when the previously purchased contract is finished.","0ecb627b112c26389825381d5280f557345ab194":"A <b>Trade Again</b> block creates a new trade and exits from the On Finish block. Now pick a Trade Again block.","6d08f40f24b29cd87eaf796ece4852012ac1a76c":"Now add it to the On Finish block","86aa77e65de8324cd6d0b7f9d5b7b74546786185":"Excellent! The <b>Trade Again</b> block starts a new trade immediately after the previous contract is finished, therefore creates an infinite loop which goes on and on until the Trade Again block isn't called e.g. in a logic block which its trade type is unmet.","70c9ae0969c05b75bb0e837567153a3b5ce1d0aa":"OK, this's it. Now we have a working bot which buys a contract after the first tick and then creates another trade which is exactly the same as before.","505f22f919520c4cd40739be12fb611c7d8b15d8":"You can use Ctrl + -/+ to zoom out/in the blocks",f49c79f5e096ac6909e0fc364980583fd20c46b6:"You can choose the account you want by the <b>Account</b> dropdown. If you cannot see the dropdown please login using the <b>Login</b> button above. Please make sure to use Virtual Account tokens for testing.","21fe96f872d9140d436c194537e731ef280d3810":"You can save/load your blocks using these buttons",d4ab4221f6388023bec133027